import React, { useContext, useState } from 'react';
import { UserContext } from '../../stores/UserStore';
import './UserPage.css';

function UserPage() {
    const [state, updateState] = useContext(UserContext);

    var root = document.getElementById('root');
    root.dataset.pageName = 'userPage';
    console.log(state);

    let userState = state;

    var dateCreated = new Date(state.dateCreated);
    console.log(dateCreated.toString());
    var dateModified = new Date(state.dateModified);

    return (
      <div className="user-page">
        <input type="text" value={userState.username}></input>
        <input type="text" value={userState.steam}></input>
        <input type="text" value={userState.twitch}></input>
        <input type="text" value={dateCreated.toString()}></input>
        <input type="text" value={userState.dateModified}></input>
      </div>
    );
  }

export default UserPage;
